import React from 'react';
import s from './ProjectCart.module.css';

const ProjectCart = (props) => {
    return (        <a href="#"><div className={s.projectCart}>
               <div className={s.project_cart_body}>
               <p id={s.project_name}>{props.header}</p>
               <span id={s.about_project}>{props.description}</span>
               <div className={s.bottom_div}>
                   <li>{props.projectLanguage}</li>
                   <span id={s.kb}>1000KB</span>
               </div>
               </div>
           </div>
           </a>
    );
}

export default ProjectCart;
